import { Box, Card, CardHeader, IconButton, Modal, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from '@mui/material'
import React, { useState } from 'react'
import { useSelector } from 'react-redux';

const style = {

}

export default function Category() {
  const { auth, restaurant } = useSelector(store => store);
  const [openCreateCategory, setOpenCreateCategory] = useState(false);

  const handleChangeCreateCategory = () => 
    setOpenCreateCategory(!openCreateCategory);

  return (
    <div>
      <Card className='mt-1'>
        <CardHeader
          title={"Categories"}
          sx={{
            pt: 2, 
            alignItems: "center", 
            "& .MuiCardHeader-action": { mt: 0.6},
          }}
          action={
            <IconButton onClick={handleChangeCreateCategory}/>
          }
          />
        <TableContainer>
          <Table sx={{}} aria-label= "table in dashboard">
            <TableHead>
              <TableRow>
                <TableCell>
                  Id
                </TableCell>
                <TableCell>
                  Name
                </TableCell>
              </TableRow>
            </TableHead>

            <TableBody>
              {restaurant.categories?.map((item, index) => (
                <TableRow>
                  <TableCell>{item?.id}</TableCell>
                  <TableCell>{item?.name}</TableCell>
                </TableRow>
              ))}
            </TableBody>

          </Table>
        </TableContainer>
      </Card>
      <Modal
        open={openCreateCategory}
        onClose={handleChangeCreateCategory}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <Box sx={style}>


        </Box>

      </Modal>
    </div>
  )
}
